import React from 'react';
import styled from 'styled-components';

const Background = styled.section`
background-color: lightgrey;
`


const Line = styled.hr`
  border-top: 1px solid darkgrey; 
  width: 100%;
`

export const Footer = () => {
  return (
    <Background>    <Line></Line>
    </Background>
  )

}
